import React from "react";

function App() {
  return (
    <div
      style={{
        backgroundColor: "#000",
        minHeight: "100vh",
        fontFamily: "Poppins, sans-serif",
        overflowX: "hidden",
        position: "relative",
        color: "#fff",
      }}
    >
      {/* Grid background */}
      <div
        style={{
          position: "absolute",
          inset: 0,
          backgroundImage:
            "radial-gradient(circle at 1px 1px, rgba(255,215,0,0.08) 1px, transparent 0)",
          backgroundSize: "40px 40px",
          zIndex: 0,
        }}
      ></div>

      {/* Content */}
      <div
        style={{
          position: "relative",
          zIndex: 2,
          textAlign: "center",
          paddingTop: "80px",
          paddingBottom: "100px",
        }}
      >
        {/* Logo */}
        <img
          src="/logo.png"
          alt="Target Marketing Logo"
          style={{
            width: "140px",
            marginBottom: "25px",
            filter: "drop-shadow(0 0 20px rgba(255,215,0,0.8))",
          }}
        />

        {/* Title */}
        <h1
          style={{
            fontSize: "3rem",
            fontWeight: 800,
            color: "#FFD700",
            textShadow: "0 0 20px #FFD700, 0 0 40px rgba(255,215,0,0.4)",
            marginBottom: "10px",
          }}
        >
          TARGET MARKETING ACADEMY
        </h1>

        {/* Subtitle */}
        <p
          style={{
            fontSize: "1.3rem",
            fontWeight: 500,
            color: "#EEE",
            textShadow: "0 0 10px rgba(255,255,255,0.3)",
            marginBottom: "25px",
          }}
        >
          Innovation. Intelligence. Impact.
        </p>

        {/* Description */}
        <p
          style={{
            maxWidth: "800px",
            margin: "0 auto 60px auto",
            lineHeight: "1.7",
            color: "#bbb",
            fontSize: "1.1rem",
          }}
        >
          A next-generation educational ecosystem merging{" "}
          <span style={{ color: "#FFD700" }}>marketing</span>,{" "}
          <span style={{ color: "#FFD700" }}>trading</span>, and{" "}
          <span style={{ color: "#FFD700" }}>AI</span> under one visionary
          platform â€” <b>GPS Systems</b>.
        </p>

        {/* Navigation Buttons */}
        <div
          style={{
            display: "grid",
            gridTemplateColumns: "repeat(auto-fit, minmax(180px, 1fr))",
            gap: "20px",
            maxWidth: "800px",
            margin: "0 auto",
          }}
        >
          {[
            "GPS TRADING",
            "GPS MARKETING",
            "GPS DROPSHIPPING",
            "GPS LANGUAGES",
            "GPS STUDIO",
          ].map((item) => (
            <button
              key={item}
              style={{
                background:
                  "linear-gradient(135deg, #FFD700, #b8860b)",
                color: "#000",
                border: "none",
                borderRadius: "12px",
                padding: "15px 25px",
                fontWeight: "700",
                letterSpacing: "0.5px",
                cursor: "pointer",
                boxShadow:
                  "0 5px 15px rgba(255,215,0,0.3), inset 0 0 10px rgba(255,255,255,0.2)",
                transition: "all 0.3s ease",
              }}
              onMouseOver={(e) => {
                e.target.style.transform = "translateY(-5px)";
                e.target.style.boxShadow =
                  "0 10px 25px rgba(255,215,0,0.6)";
              }}
              onMouseOut={(e) => {
                e.target.style.transform = "translateY(0)";
                e.target.style.boxShadow =
                  "0 5px 15px rgba(255,215,0,0.3)";
              }}
            >
              {item}
            </button>
          ))}
        </div>
      </div>

      {/* Footer */}
      <footer
        style={{
          textAlign: "center",
          padding: "20px 0",
          color: "#888",
          fontSize: "0.9rem",
        }}
      >
        Â© 2025 Target Marketing Systems | Powered by GPS AI
      </footer>
    </div>
  );
}

export default App;
